import { Link, Outlet } from 'react-router-dom';

function Navbar() {
    return ( 
        <div>
        <nav className='navbar'>
            <h1>React Website</h1>
            <div className='links'>
                <Link to="/">Home</Link>
                <Link to="/home">Home</Link>
                <Link to="/login">LoginPage</Link>
                <Link to="/loggedIn">AfterLogin</Link>
            </div>
        </nav>
        {/* <Outlet /> */}
        </div>
     );
}

export default Navbar;
